// carousel with 2 slides
function carousel() {
    var $carousel = $('.carousel-main .carousel__list'),
        $carouselItem = $('.carousel-main .carousel__item'),
        $button = $('.carousel-main .carousel__btn'),
        carouselItemWidth = $carousel.find('.carousel__item').outerWidth(true),
        initialPosition = carouselItemWidth * (-2),
        offset = initialPosition,
        carouseLength = $carouselItem.length,
        carouselLengthWithClone = $carouselItem.length + 2,
        maxOffsetRight = carouselLengthWithClone * carouselItemWidth,
        maxOffsetLeft = carouseLength * carouselItemWidth,
        minOffset = 0,
        carouselWidth = 0,
        clonedItemLength = 0,
        windowWidth = $(window).width();




        var $cloneFirstElement = $carouselItem.filter(':first').clone().addClass('cloned');
        var $cloneAfterFirstElement = $($carousel.children()[1]).clone().addClass('cloned');
        var $cloneLastElement = $carouselItem.filter(':last').clone().addClass('cloned');
        var $cloneBeforeLastElement = $($carousel.children()[carouseLength - 2]).clone().addClass('cloned');

        $cloneFirstElement.appendTo('.carousel-main .carousel__list');
        $cloneAfterFirstElement.appendTo('.carousel-main .carousel__list');
        $cloneLastElement.prependTo('.carousel-main .carousel__list');
        $cloneBeforeLastElement.prependTo('.carousel-main .carousel__list');

        clonedItemLength = $('.carousel-main .cloned').length;
        carouselWidth = ($carouselItem.length + clonedItemLength) * carouselItemWidth;

        $carousel.css({'left': initialPosition, 'width': carouselWidth});

        $button.click(function () {
            if ($(this).hasClass('carousel__btn--next')) {
                offset -= carouselItemWidth;
                $carousel.css({'left': offset});
                if (offset == -maxOffsetRight) {
                    offset = initialPosition;
                    $carousel.one('webkitTransitionEnd otransitionend oTransitionEnd msTransitionEnd transitionend',
                        function (e) {
                            $carousel.css({'left': offset, 'transition-duration': '0s'});
                        });
                }
            } else {
                offset += carouselItemWidth;
                $carousel.css({'left': offset});
                if (offset == minOffset) {
                    offset = -maxOffsetLeft;
                    $carousel.one('webkitTransitionEnd otransitionend oTransitionEnd msTransitionEnd transitionend',
                        function (e) {
                            $carousel.css({'left': offset, 'transition-duration': '0s'});
                        });
                }
            }
            $carousel.css({'transition-duration': '.3s'});
        });
    if(windowWidth < 768){
        carouselWidth = ($carouselItem.length + clonedItemLength) * carouselItemWidth;
        $carousel.css({'width': carouselWidth+40});
    }
}



$(function() {
    function addFixMenu() {
        if ($(window).width() > 1400) {
            if (menuOffsetTop < $(window).scrollTop()) {

                if (!menuEl.hasClass('-fix')) {
                    menuEl.addClass('-fix');
                    $('main').css('marginTop', menuHeight);
                    $('.hide-submenu .menu--submenu').hide();
                    $('.hide-submenu .menu--main').find('a.-active').removeClass('-has-child');
                }
            } else {
                menuEl.removeClass('-fix');
                $('main').css('marginTop', 0);
                $('.hide-submenu .menu--main').find('a.-active').addClass('-has-child');
                $('.hide-submenu .menu--submenu').show();
            }
        }
    }

    var menuEl = $("#menu-to-fix");
    var menuOffsetTop = menuEl.offset().top;
    var menuHeight = menuEl.height();


    addFixMenu();
    $(document).scroll(function(e){
        if (!menuEl.hasClass('-fix')){
            menuOffsetTop = menuEl.offset().top;
        }
        addFixMenu();
    });



    var resizeTimer;
    $(window).on('resize', function(e) {

        clearTimeout(resizeTimer);
        resizeTimer = setTimeout(function() {
            if ($(window).width() < 1400){
                menuEl.removeClass('-fix');
                $('main').css('marginTop', 0);
            }
        }, 250);

    });

});

$(function() {

    $(document).on('click', '.quiz-start-test', function(){
        var id = $(this).attr('data-quiz-id');
        $('.quiz[data-quiz-id="' + id + '"]').addClass('with-loader');
        $(this).hide();
        $.ajax({
            method: "POST",
            url: "/quiz/start_quiz",
            data: { id: id },
            success: function(data){
                $('.quiz[data-quiz-id="' + id + '"]').replaceWith(data);
                showQuizShareButtons(id, false);
                $('.quiz[data-quiz-id="' + id + '"]').removeClass('with-loader');
            }
        });
    });

    $(document).on('click', '.quiz-answer.clickable', function(){
        var id = $('.quiz[data-question-id="' + $(this).attr('data-question-id') + '"]').attr('data-quiz-id');
        var answer = $(this).attr('data-id');
        $('.quiz[data-quiz-id="' + id + '"]').addClass('with-loader');
        $.ajax({
            method: "POST",
            url: "/quiz/answer",
            dataType: 'JSON',
            data: { id: id, question: $(this).attr('data-question-id'), answer: answer },
            success: function(data){
                $('.quiz[data-quiz-id="' + id + '"]').find('.quiz-answer').each(function(){
                    $(this).removeClass('clickable');
                    if (typeof data[$(this).attr('data-id')] !== 'undefined'){
                        if (data[$(this).attr('data-id')] && answer == $(this).attr('data-id')){
                            $(this).addClass('answer-correct');
                        } else if (data[$(this).attr('data-id')] && answer != $(this).attr('data-id')){
                            $(this).addClass('answer-was-correct');
                        } else if (!data[$(this).attr('data-id')] && answer == $(this).attr('data-id') ){
                            $(this).addClass('answer-wrong');
                        } else {
                            $(this).addClass('answer-non');
                        }
                    }
                });
                $('.quiz[data-quiz-id="' + id + '"]').find('.quiz-continue-test').attr('disabled', false);
                $('.quiz[data-quiz-id="' + id + '"]').removeClass('with-loader');
            }
        });

    });

    $(document).on('click', '.quiz-continue-test', function(){
        var id = $(this).attr('data-quiz-id');
        $('.quiz[data-quiz-id="' + id + '"]').addClass('with-loader');
        $.ajax({
            method: "POST",
            url: "/quiz/continue",
            data: { id: id },
            success: function(data){
                $('.quiz[data-quiz-id="' + id + '"]').replaceWith(data);
                if ($('.quiz[data-quiz-id="' + id + '"]').attr('data-progress-id')) {
                    showQuizShareButtons(id, $('.quiz[data-quiz-id="' + id + '"]').attr('data-progress-id'));
                } else {
                    showQuizShareButtons(id, false);
                }
                $('.quiz[data-quiz-id="' + id + '"]').removeClass('with-loader');
            }
        });
    });

    function showQuizShareButtons(id, hash){
        var url = $('meta[property="og:url"]').attr('content');
        if (!url) {
            return false;
        }

        if (hash) {
            url += '?progress=' + hash;
        } else {
            url += '?quiz=' + id;
        }
        var quizBlock = $('.quiz[data-quiz-id="' + id + '"');
        var shareLink = quizBlock.find('.quiz-share-fb');
        var href = 'http://www.facebook.com/sharer.php?u=' + url;
        shareLink.attr(
            'onclick', 'window.open(\'' + href + '\',\'name\',\'width=600,height=400\')'
        );

        shareLink = quizBlock.find('.quiz-share-vk');
        href = 'http://vk.com/share.php?url=' + url + '&title=' + shareLink.attr('data-title');
        shareLink.attr(
            'onclick', 'window.open(\'' + href + '\',\'name\',\'width=600,height=400\')'
        );

        shareLink = quizBlock.find('.quiz-share-twitter');
        href = 'http://twitter.com/share?url=' + url + '&text=' + shareLink.attr('data-title');
        shareLink.attr(
            'onclick', 'window.open(\'' + href + '\',\'name\',\'width=600,height=400\')'
        );
    }
});
